import React from "react";
import "./SoftwareSkill.css";
import { OverlayTrigger, Tooltip } from "react-bootstrap";
import { maxlogoTransparente } from "../../assests/images/maxlogoTransparente.png";
function SoftwareSkill(props) {
  const changeImage = (logo) => {
    console.log("csdsd", logo);
    if (logo.styles === "images") {
      return (
        <img
          src={require(`../../assests/logo.fontAwesomeClassname}`)}
          className="iconify"
          style={{ height: "15px" }}
        />
      );
    } else {
      return (
        <span
          className="iconify"
          data-icon={logo.fontAwesomeClassname}
          style={logo.style}
          data-inline="false"
        ></span>
      );
    }
  };
  return (
    <div>
      <div className="software-skills-main-div">
        <ul className="dev-icons">
          {props.logos.map((logo) => {
            return (
              <OverlayTrigger
                key={logo.skillName}
                placement={"top"}
                overlay={
                  <Tooltip id={`tooltip-top`}>
                    <strong>{logo.skillName}</strong>
                  </Tooltip>
                }
              >
                <li className="software-skill-inline" name={logo.skillName}>
                  {/* <span
                    className="iconify"
                    data-icon={logo.fontAwesomeClassname}
                    style={logo.style}
                    data-inline="false"
                  ></span> */}
                  {changeImage(logo)}
                </li>
              </OverlayTrigger>
            );
          })}
        </ul>
      </div>
    </div>
  );
}

export default SoftwareSkill;
